clear;
clc;
close all;
tic
global v E ho ro dr
% With the below parameters the code will take approx. 5 minutes

%% Geometry

ro = 0.1/2;       		% Outer radius: meters
dr = 0.0005*ro;			% Mesh/grid size in radial domain: meters
r = 0.0000001:dr:ro;

%% Material properties

ho = 200e-6;		% Initial thickness of the membrane: meters
Sy = 14.16e6;		% Yield strength: Pa
v = 0.4;			% Poisson's ratio
E = 1.1e9;			% Elastic Modulus: Pa
Et = 96.8e6;		% Tangent Modulus: Pa
H=E*Et/(E-Et);		% Plastic Modulus: Pa

%% Elastic deformation
so=1e6:1e6:Sy;				
for i=1:length(so)
    disp(['Equivalent stress at the apex for next step: ' num2str(so(i)/1e6) ' MPa'] )
    [w_max_e(i),er_center_e(i),er_edge_e(i),phi(:,i),s(:,i),er(:,i),eth(:,i),eh(:,i),sr(:,i),sth(:,i),w(:,i),dw(:,i),dphi(:,i),pj(i)] = Elastic_range (so(i));
end

jstart = length(pj);
p=pj(jstart);

deth(:,jstart) = gradient(eth(:,jstart),r);
deh(:,jstart) = gradient(eh(:,jstart),r);
ds(:,jstart) = gradient(s(:,jstart),r);
dphi(:,jstart) = gradient(phi(1:end-1,jstart),r(1:end-1));

del_s = 0.05e6;					% Stress increment at the apex: Pa
s_end = 18e6;					% Maximum stress at the apex: Pa

counter = jstart + round( (s_end-Sy)/del_s );

for j=jstart:counter    

    s(1,j+1) = s(1,j) + del_s;
	
	disp(['Equivalent stress at the apex for next step: ' num2str(s(1,j+1)/1e6) ' MPa'] )
    
    phi(1,j+1) = atan(1/sqrt(3)); 
    
    eth(1,j+1) = eth(1,j)+((-1).*s(1,j)+s(1,j+1)).*(E.^(-1).*( ...
        3.^(-1/2)+(-2).*3.^(-1/2).*v).*cos(phi(1,j))+E.^(-1).*sin(phi(1,j)))...
        +((-1).*phi(1,j)+phi(1,j+1)).*(E.^(-1).*cos(phi(1,j)).*s(1,j)+E.^(-1).*((-1).*3.^(-1/2).*s(1,j)+2.*3.^(-1/2).*v.*s(1,j)).* ...
        sin(phi(1,j)));
    
    eth(end-1,j+1)=1;

    p_inc = 10^(round(log10(p))-3);    	% Pressure increment: Pa     

    iter = 1;
	
    while  abs(eth(1,j+1)/eth(end-1,j+1)) < 100 || eth(end-1,j+1) < 0 

        for i=1:1:length(r)-1 
        
            sr(i,j+1) = (2.*3.^(-1/2).*cos(phi(i,j+1)).*s(i,j+1));

            sth(i,j+1) = s(i,j+1).*(1/sqrt(3)*cos(phi(i,j+1)) + sin(phi(i,j+1)));

                if s(i,j) > Sy  
                                        										
                    rp(i,j)=r(i);

                    er(i,j+1) = er(i,j) + (1/2).*((-1).*s(i,j)+s(i,j+1)).*((2.*3.^( ...
                        -1/2).*E.^(-1)+(1/2).*3.^(1/2).*H.^(-1)+(-1).*3.^(-1/2).*E.^(-1) ...
                        .*v).*cos(phi(i,j))+(2.*3.^(-1/2).*E.^(-1)+(1/2).*3.^(1/2).*H.^( ...
                        -1)+(-1).*3.^(-1/2).*E.^(-1).*v).*cos(phi(i,j+1))+((-1/2).*H.^( ...
                        -1)+(-1).*E.^(-1).*v).*sin(phi(i,j))+((-1/2).*H.^(-1)+(-1).*E.^( ...
                        -1).*v).*sin(phi(i,j+1)))+(1/2).*((-1).*phi(i,j)+phi(i,j+1)).*(( ...
                        -1).*E.^(-1).*v.*cos(phi(i,j)).*s(i,j)+(-1).*E.^(-1).*v.*cos( ...
                        phi(i,j+1)).*s(i,j+1)+((-2).*3.^(-1/2).*E.^(-1).*s(i,j)+3.^( ...
                        -1/2).*E.^(-1).*v.*s(i,j)).*sin(phi(i,j))+((-2).*3.^(-1/2).*E.^( ...
                        -1).*s(i,j+1)+3.^(-1/2).*E.^(-1).*v.*s(i,j+1)).*sin(phi(i,j+1) ...
                        ));

                    eth(i,j+1) = eth(i,j)+(1/2).*((-1).*s(i,j)+s(i,j+1)).*((3.^( ...
                        -1/2).*E.^(-1)+(-2).*3.^(-1/2).*E.^(-1).*v).*cos(phi(i,j))+(3.^( ...
                        -1/2).*E.^(-1)+(-2).*3.^(-1/2).*E.^(-1).*v).*cos(phi(i,j+1))+( ...
                        E.^(-1)+H.^(-1)).*sin(phi(i,j))+(E.^(-1)+H.^(-1)).*sin(phi(i,j+1)))+(1/2).*((-1).*phi(i,j)+phi(i,j+1)).*(E.^(-1).*cos(phi(i,j)) ...
                        .*s(i,j)+E.^(-1).*cos(phi(i,j+1)).*s(i,j+1)+((-1).*3.^(-1/2).* ...
                        E.^(-1).*s(i,j)+2.*3.^(-1/2).*E.^(-1).*v.*s(i,j)).*sin(phi(i,j)) ...
                        +((-1).*3.^(-1/2).*E.^(-1).*s(i,j+1)+2.*3.^(-1/2).*E.^(-1).*v.* ...
                        s(i,j+1)).*sin(phi(i,j+1)));

                    eh(i,j+1) = (eh(i,j)+(1/2).*((-1).*s(i,j)+s(i,j+1)).*(((-1/2).* ...
                        3.^(1/2).*H.^(-1)+(-1).*3.^(1/2).*E.^(-1).*v).*cos(phi(i,j))+(( ...
                        -1/2).*3.^(1/2).*H.^(-1)+(-1).*3.^(1/2).*E.^(-1).*v).*cos(phi(i,j+1))+((-1/2).*H.^(-1)+(-1).*E.^(-1).*v).*sin(phi(i,j))+((-1/2) ...
                        .*H.^(-1)+(-1).*E.^(-1).*v).*sin(phi(i,j+1)))+(1/2).*((-1).*phi(i,j)+phi(i,j+1)).*((-1).*E.^(-1).*v.*cos(phi(i,j)).*s(i,j)+(-1) ...
                        .*E.^(-1).*v.*cos(phi(i,j+1)).*s(i,j+1)+3.^(1/2).*E.^(-1).*v.* ...
                        s(i,j).*sin(phi(i,j))+3.^(1/2).*E.^(-1).*v.*s(i,j+1).*sin(phi(i,j+1))));
                    
                   	e(i,j+1) = sqrt(2)/3*sqrt( (er(i,j+1)-eth(i,j+1)).^2 + (er(i,j+1)-eh(i,j+1)).^2 + (eh(i,j+1)-eth(i,j+1)).^2 );
                    
                    dw(i,j+1) = (-1/2).*exp(-eh(i,j+1)+er(i,j+1)+eth(i,j+1)).*ho.^(-1).*p.*r(i).*sr(i,j+1).^(-1);

                    ds(i,j+1) = (exp((-1).*eth(i,j+1)).*r(i).^(-1).*(s(i,j).*(8.*E.*H.*cos(phi(i,j+1)).*((-1).*3.^(1/2).*H.*cos(phi(i,j))+3.^(1/2).*(E+H).*cos(phi(i,j+1))+(-1).*H.*((-1)+2.*v).*(sin(phi(i,j))+(-1).*sin(phi(i,j+1))))+(-1).*(E.*(3.*3.^(1/2).*E+3.^(1/2).*H+4.*3.^(1/2).*H.*v+2.*3.^(1/2).*H.*((-1)+2.*v).*cos(2.*phi(i,j))+3.^(1/2).*(3.*E+H+4.*H.*v).*cos(phi(i,j)+(-1).*phi(i,j+1))+(-2).*3.^(1/2).*H.*cos(phi(i,j)+phi(i,j+1))+4.*3.^(1/2).*H.*v.*cos(phi(i,j)+phi(i,j+1))+3.*H.*sin(phi(i,j)+(-1).*phi(i,j+1))+(-6).*H.*v.*sin(phi(i,j)+(-1).*phi(i,j+1)))+H.*phi(i,j+1).*((-4).*3.^(1/2).*H.*v.*(1+v).*sin(phi(i,j)+(-1).*phi(i,j+1))+(-1).*E.*((-1)+2.*v).*((-3)+2.*3.^(1/2).*sin(2.*phi(i,j+1))))+H.*phi(i,j).*(4.*3.^(1/2).*H.*v.*(1+v).*sin(phi(i,j)+(-1).*phi(i,j+1))+E.*((-1)+2.*v).*((-3)+2.*3.^(1/2).*sin(2.*phi(i,j+1))))).*sr(i,j+1))+s(i,j+1).*((-8).*3.^(1/2).*E.^2.*H+(-12).*3.^(1/2).*E.*H.^2+(-4).*3.^(1/2).*E.^2.*H.*cos(phi(i,j)+(-1).*phi(i,j+1))+(-4).*3.^(1/2).*E.*H.^2.*cos(phi(i,j)+(-1).*phi(i,j+1))+(-4).*3.^(1/2).*E.*H.^2.*cos(2.*phi(i,j+1))+4.*3.^(1/2).*E.^2.*H.*cos(phi(i,j)+phi(i,j+1))+4.*3.^(1/2).*E.*H.^2.*cos(phi(i,j)+phi(i,j+1))+4.*E.*H.^2.*sin(phi(i,j)+(-1).*phi(i,j+1))+(-8).*E.*H.^2.*v.*sin(phi(i,j)+(-1).*phi(i,j+1))+4.*E.*H.^2.*sin(2.*phi(i,j+1))+(-8).*E.*H.^2.*v.*sin(2.*phi(i,j+1))+(-4).*E.*H.^2.*sin(phi(i,j)+phi(i,j+1))+8.*E.*H.^2.*v.*sin(phi(i,j)+phi(i,j+1))+3.*3.^(1/2).*E.^2.*sr(i,j+1)+3.*3.^(1/2).*E.*H.*sr(i,j+1)+12.*3.^(1/2).*E.*H.*v.*sr(i,j+1)+8.*3.^(1/2).*H.^2.*v.*sr(i,j+1)+8.*3.^(1/2).*H.^2.*v.^2.*sr(i,j+1)+3.*3.^(1/2).*E.^2.*cos(phi(i,j)+(-1).*phi(i,j+1)).*sr(i,j+1)+3.*3.^(1/2).*E.*H.*cos(phi(i,j)+(-1).*phi(i,j+1)).*sr(i,j+1)+12.*3.^(1/2).*E.*H.*v.*cos(phi(i,j)+(-1).*phi(i,j+1)).*sr(i,j+1)+8.*3.^(1/2).*H.^2.*v.*cos(phi(i,j)+(-1).*phi(i,j+1)).*sr(i,j+1)+8.*3.^(1/2).*H.^2.*v.^2.*cos(phi(i,j)+(-1).*phi(i,j+1)).*sr(i,j+1)+2.*3.^(1/2).*E.*H.*cos(2.*phi(i,j+1)).*sr(i,j+1)+(-4).*3.^(1/2).*E.*H.*v.*cos(2.*phi(i,j+1)).*sr(i,j+1)+2.*3.^(1/2).*E.*H.*cos(phi(i,j